import React from "react";
import "./RecipeExtraInfo.css";
import CardInfo from "../../cardInfo/CardInfo";
import Link from "../../../ui/Link";

export default function RecipeExtraInfo() {
  return (
    <div className="RecipeExtraInfo">
      <CardInfo
        header="Looking for recipes?"
        text="Discover more than 1000 fantastic recipes with Sousmate. You will love them!"
        className="InlineBlock"
        extraClass="ExtraInfo"
      />
      <CardInfo
        header="Recipes by Ingredient"
        text="Narrow your search by main ingredient to find recipes and meal ideas fast:"
        link={
          <Link
            target="_blank"
            rel="noopener noreferrer"
            href="https://www.myrecipes.com/ingredients"
            text="myrecipes.com"
          />
        }
        className="InlineBlock"
        extraClass="ExtraLink"
      />
      <CardInfo
        header="Who we are?"
        text="Sousmate exists 10 years. We have 1 million subscribers and more than 100 employees."
        className="InlineBlock"
        extraClass="ImportantInfo"
      />
    </div>
  );
}
